                    </div>

                    {/*<MDBBtn className="mb-4 w-100" size="lg" type="submit">Sign in</MDBBtn> */}

                    <div class="col-12">
                        <button class="btn btn-primary mb-4 w-100" size="lg" id='logSubmit' type="submit" >Sign in</button>
                    </div>
                </MDBCol>
            </MDBRow>
        </MDBContainer>
    );
};

export default TLogin;
